import Countdown from "../components/Header/Countdown";
import Menu from '../components/Header/Menu';
import React from "react";
import SignInButton from '../components/Header/SignInButton';

class Header extends React.Component {
    render() {
        if(this.props.signedIn){
            return (
                <div className="headerSignedIn">
                    <Countdown />
                    <div className="message">
                        <p>Paul and Elyse</p>
                        <p>Wedding</p>
                    </div>      
                    <Menu menuSelection={this.props.menuSelection}/> 
                </div>   
            )
        }else {
            return (
                <div className="headerSignedOut">
                    <Countdown />
                    <SignInButton toggleForm={this.props.toggleForm} openForm={this.props.openForm}/>
                    <div className="message">
                        <p>Paul and Elyse's</p>
                        <p>Wedding</p>
                    </div>      
                </div>
            )
        }
    }

}

export default Header;
